INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24001, "あたしだって\nやるときはやるよ！", 0.0, "2020/04/30 12:00:00", 1, 0, 1, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, "2020/04/30 12:00:00", 1, 1, 1, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, "2020/04/30 12:00:00", 1, 2, 1, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24004, "やったね！\nこれでようやく\nサボれるよ…", 0.0, "2020/04/30 12:00:00", 2, 3, 2, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, "2020/04/30 12:00:00", 1, 4, 1, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, "2020/04/30 12:00:00", 2, 5, 2, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24007, "あたしも意外と\nやるもんでしょ？", 0.0, "2020/04/30 12:00:00", 2, 6, 2, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, "2020/04/30 12:00:00", 4, 7, 4, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, "2020/04/30 12:00:00", 4, 8, 4, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24010, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, "2020/04/30 12:00:00", 4, 9, 4, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24011, "やられた…\nねずみって意外と\nてごわいね", 0.0, "2020/04/30 12:00:00", 4, 10, 4, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 0.0, "リン", 0.0, 24, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, "2020/04/30 12:00:00", 4, 11, 4, 10040);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, "2030/12/17 14:59:59", 1.81, "リン", 0.0, 24, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, "2020/04/30 12:00:00", 1, 12, 4, 10040);
